import styled from 'styled-components';

export const Container = styled.div`
    min-height: 100px;
    width: 80%;
    margin: 0 auto;
`;

export const List = styled.div`
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
    width: 100%;
    list-style: none;
    padding: 20px 0;
`;

export const Image = styled.img`
    width: 100%;
`;

export const Item = styled.li`
    color: white;
`;
